unction (range, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"161882","type":"CustomJS"},{"attributes":{},"id":"161702","type":"LinearScale"},{"attributes":{"coordinates":null,"data_source":{"id":"161729"},"glyph":{"id":"161806"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"161808"},"nonselection_glyph":{"id":"161807"},"view":{"id":"161810"}},"id":"161809","type":"GlyphRenderer"},{"attributes":{"data":{"Close":{"__ndarray__":"cT0K16O4bUCkcD0K14ttQD0K16NwhWxA9ihcj8LFbEA9CtejcN1tQD0K16NwtW1AexSuR+FCbkCuR+F6FC5uQK5H4XoUpm5Aj8L1KFwPb0AAAAAAAEBvQHsUrkfhum5AMzMzMzOTbkAzMzMzM7tuQAAAAAAA0G1ArkfhehTmbEBcj8L1KFRuQGZmZmZmjm5A9ihcj8IdbkBI4XoUrl9uQAAAAAAAEG5A9ihcj8L9bUAK16NwPZpuQArXo3A9DnBAmpmZmZkBcEC4HoXrUWhwQEjhehSuj3BApHA9CtevcEDXo3A9CtdwQAAAAAAAfHBAPQrXo3DNcEAzMzMzM8dwQB+F61G42nBAcT0K16PEcEDNzMzMzOxwQEjhehSu+3BA4XoUrkftcEDsUbgehaNwQIXrUbgepXBACtejcD0GcUDXo
